import React from "react";
import RouterAbout from "./RouterAbout";
import RouterService from "./RouterService";
import RouterContact from "./RouterContact";
import Error from "./Error";
import Menu from "./Menu";
import {Switch , Route } from "react-router-dom";

const Router = () => {
    return (
        <>
        <Menu/>
        <Switch>
            <Route exact path = "/" component = {RouterAbout}></Route>
            <Route exact path = "/service" component = {RouterService}></Route>
            <Route exact path = "/contact" component = {RouterContact}></Route>
            <Route component = {Error}></Route>
        </Switch>

        </>
    );
}

export default Router;
